import React from "react";
import VIT from '../components/pages/image/2.jpg'


function Footer() {
 
  return (
    <div className="Foot" >
      <h1 className="Headfoo">I Study At</h1>
      <img className='foot-img' src={VIT} width='80vw' height='20vh'/>
    </div>
  )
};

export default Footer;
